package number_of_substrings_containing_all_three_characters

import (
	"testing"
)

func TestNumberOfSubstrings(t *testing.T) {
	tests := []struct {
		name   string
		input  string
		expect int
	}{
		{
			name:   "abcabc",
			input:  "abcabc",
			expect: 10,
		},
		{
			name:   "abc",
			input:  "abc",
			expect: 1,
		},
		{
			name:   "aaacb",
			input:  "aaacb",
			expect: 3,
		},
		{
			name:   "long",
			input:  "",
			expect: 0,
		},
	}
	for _, test := range tests {
		t.Run(test.name, func(t *testing.T) {
			if get := numberOfSubstrings(test.input); get != test.expect {
				t.Errorf("(%s) = %d != %d", test.input, get, test.expect)
			}
		})
	}
}
